(window.webpackJsonp=window.webpackJsonp||[]).push([[223],{576:function(n,h,g){"use strict";g.r(h);var i=g(44),t=Object(i.a)({},(function(){var n=this,h=n.$createElement,g=n._self._c||h;return g("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[g("h1",{attrs:{id:"chuong-1178-ta-truong-huyen-xong-đuong"}},[g("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1178-ta-truong-huyen-xong-đuong"}},[n._v("#")]),n._v(" Chương 1178: Ta Trương Huyền, xông đường!")]),n._v(" "),g("hr"),n._v(" "),g("p",[g("br"),g("br"),n._v("“Cẩu đường chủ, chuyện này, ta cùng Chiến sư đường Hình đường chủ tận mắt nhìn thấy, sự thật vô cùng xác thực, không cho phản bác...”"),g("br"),g("br"),n._v("Ngô sư thanh âm lo lắng truyền đến."),g("br"),g("br"),n._v("“Sự thật vô cùng xác thực?”"),g("br"),g("br"),n._v("Lão giả thanh âm tiếp tục vang lên: “Thân là danh sư, ngươi hẳn phải biết, có một số việc, tận mắt thấy chưa chắc là thật! Cần cẩn thận xác định, cẩn thận phân biệt, mới có thể kết luận... Huống chi, dính dáng một vị phó đường chủ! Nếu như dựa theo như ngươi loại này phán quyết, chúng ta Thanh Nguyên đế quốc Danh Sư đường phó đường chủ, mưu hại một cái từ nhất đẳng đế quốc tới lục tinh danh sư... Chúng ta phân bộ, về sau còn có sao uy nghiêm có thể nói?”"),g("br"),g("br"),n._v("“Cái này...”"),g("br"),g("br"),n._v("Ngô sư thanh âm trù trừ."),g("br"),g("br"),n._v("Danh Sư đường, canh giữ một phương, mặt mũi mười phần quan trọng, phó đường chủ gia hại so với hắn cấp bậc thấp người, chỉ bằng vào điểm ấy, lan truyền ra ngoài, bọn họ Thanh Nguyên đế quốc Danh Sư đường phân bộ, liền không mặt mũi gặp người, về sau cõng không biết bao lâu bêu danh."),g("br"),g("br"),n._v("“Cẩu đường chủ, ta nói chính là sự thật, Danh Sư đường hẳn là làm gương tốt, nói đúng sự thật, nếu vì thanh danh, cố ý bao che, về sau còn có sao công chính đáng nói?”"),g("br"),g("br"),n._v("Dừng lại một chút, Ngô sư tiếp tục nói."),g("br"),g("br"),n._v("Xử lý Điền Thanh phó đường chủ, quả thực sẽ có tổn hại phân bộ uy danh, nhưng mà không xử lý lời nói, truyền đi, sẽ càng gian nan nghe, đại lục đệ nhất chức nghiệp, cũng mất công chính đáng nói."),g("br"),g("br"),n._v("“Công chính? Ngươi nói chẳng lẽ liền là công chính? Làm sao, ta nghe được ngược lại là Điền phó đường chủ, nhận lấy oan ức!”"),g("br"),g("br"),n._v("Lão giả thanh âm tiếp tục vang lên: “Điền Thanh, ngươi đem chuyện ngày hôm qua, lại nói rõ chi tiết một lần!”"),g("br"),g("br"),n._v("“Đúng!”"),g("br"),g("br"),n._v("Trong phòng vang lên Điền phó đường chủ thanh âm."),g("br"),g("br"),n._v("“Chuyện là như thế này, Trung Thanh Vương phụ trách nội thành phòng vệ, bắt lấy Hồng Viễn đế quốc Độc điện phó điện chủ Minh Chân, mượn nhờ đối phương tin tức, đem Độc điện Tĩnh Viễn thành phân bộ tiêu diệt... Càng từ vị này phó điện chủ trong miệng, biết còn có một vị vô cùng lợi hại độc sư, gọi là Tôn Cường, ẩn thân nội thành, vô cùng có khả năng để toàn thành nhân tộc, đối mặt nguy hiểm... Cho nên, mới đem bắt lấy thẩm vấn, mà vị này Tôn Cường, chính là Trương Huyền Trương sư quản gia!”"),g("br"),g("br"),n._v("“Dính dáng một vị danh sư, tự nhiên không thể lỗ mãng, Trung Thanh Vương tìm được ta, ta liền để hắn phái người mời... Đến vương phủ về sau, vị này Trương Huyền, không những không phối hợp, còn đem Tôn Cường ra tay cướp đi, càng là đối với ta cùng Trung Thanh Vương ra tay đánh nhau...”"),g("br"),g("br"),n._v("“Ra tay đánh nhau? Điền phó đường chủ, Trương sư thực lực, chỉ có Thánh vực nhị trọng đỉnh phong, ngươi lại là nửa bước Xuất Khiếu cảnh, nói đúng ngươi ra tay... Có chút quá đáng a?”"),g("br"),g("br"),n._v("Hai hàng lông mày nâng lên, Ngô sư tràn đầy không vui."),g("br"),g("br"),n._v("Trương sư là trời nhận danh sư sự tình, hắn không thể nói ra được, nhưng mà, đối phương muốn vu oan, tuyệt đối sẽ không lưu tình chút nào phản kích."),g("br"),g("br"),n._v("“Đem ta đả thương, cũng không phải là Trương Huyền, mà là trong tay hắn một cái lô đỉnh! Cái này lô đỉnh, là trung phẩm Thánh khí, cùng thực lực của ta tương đương...”"),g("br"),g("br"),n._v("Điền Thanh nói."),g("br"),g("br"),n._v("“Ta thì càng không tin, thân là danh sư, lại bị một cái trung phẩm Thánh khí cấp bậc lô đỉnh đánh?” Ngô sư lắc đầu."),g("br"),g("br"),n._v("Trung phẩm Thánh khí là lợi hại, nhưng không có người khởi động, không phát huy ra được mạnh nhất sức chiến đấu, đem một cái đường đường danh sư, đánh một trận... Nói cho ai nghe, ai tin tưởng?"),g("br"),g("br"),n._v("“Tin cũng tốt không tin cũng tốt, nếu như ngươi nhất định phải nói ta mưu hại Trương Huyền, vậy ta hỏi ngươi... Ta nhưng có mưu hại lý do?”"),g("br"),g("br"),n._v("Điền phó đường chủ khẽ nói."),g("br"),g("br"),n._v("“Cái này...”"),g("br"),g("br"),n._v("Ngô sư câm ở."),g("br"),g("br"),n._v("“Ta là Thanh Nguyên đế quốc Danh Sư đường phó đường chủ, nói đến địa vị, so với hắn kính trọng không biết gấp bao nhiêu lần! Thân là thất tinh danh sư, đẳng cấp cũng vượt xa với hắn... Vì sao phải bốc lên hủy đi chức nghiệp kiếp sống nguy hiểm, đi cố ý đối phó một cái, không có quan hệ gì với ta học viện viện trưởng? Cho dù bị giết, hoặc là khai trừ danh sư tư cách, đều cùng ta không có bất cứ quan hệ nào đi!”"),g("br"),g("br"),n._v("Điền phó đường chủ nói."),g("br"),g("br"),n._v("Ngô sư nói không ra lời."),g("br"),g("br"),n._v("Quả thực, gây án phải có động cơ."),g("br"),g("br"),n._v("Điền phó đường chủ bất kể từ một cái kia phương diện nhìn, đều không tồn tại những thứ này."),g("br"),g("br"),n._v("Thân phận cao hơn ngươi, địa vị cao hơn ngươi, mấu chốt vẫn còn so sánh ngươi có tiền... Tại sao phải đối phó ngươi một cái nông thôn đến tiểu tử?"),g("br"),g("br"),n._v("Không có đạo lý ah!"),g("br"),g("br"),n._v("“Ngô Như Phong, ngươi có lời gì nói?”"),g("br"),g("br"),n._v("Vừa rồi cái kia Cẩu đường chủ thanh âm tiếp tục vang lên."),g("br"),g("br"),n._v("“Ta... Mặc dù không biết, Điền phó đường chủ vì sao phải đối Trương sư động thủ, nhưng ta nhận được Trương sư cầu cứu tin tức, tiến đến thời điểm, Trung Thanh Vương cùng Điền phó đường chủ đang tại động thủ với hắn, chỉ cần muộn đi một hồi, chỉ sợ cũng đã bị giết, đây là ta cùng rất nhiều danh sư, Chiến sư tận mắt nhìn thấy, đường chủ không tin, có thể hỏi thăm...”"),g("br"),g("br"),n._v("Ngô sư nói: “Hơn nữa, Điền phó đường chủ mới vừa nói vị kia Độc điện phó điện chủ, có thể làm chứng, là Trung Thanh Vương cùng Điền phó đường chủ lấy Độc điện mọi người làm uy hiếp, cố ý mưu hại...”"),g("br"),g("br"),n._v("“Ngươi nói thế nhưng là vị kia kêu Minh Chân độc sư?”"),g("br"),g("br"),n._v("Cẩu đường chủ thanh âm nói."),g("br"),g("br"),n._v("“Đúng!”"),g("br"),g("br"),n._v("“Hắn buổi tối hôm qua đã chết!” Cẩu đường chủ hừ lạnh."),g("br"),g("br"),n._v("“Chết rồi? Hắn tại Danh Sư đường... Làm sao sẽ chết?” Ngô sư dường như khó tin."),g("br"),g("br"),n._v("“Ta làm sao biết tại sao lại chết? Người là ngươi bắt tới, sau đó lại chết tại Danh Sư đường, ngươi nói không biết... Ngươi cảm thấy ta sẽ tin tưởng?” Cẩu đường chủ nói."),g("br"),g("br"),n._v("“Đường chủ đây là... Hoài nghi ta?”"),g("br"),g("br"),n._v("Ngô sư trong giọng nói mang theo không tin."),g("br"),g("br"),g("span",[g("br"),n._v("[ truy"),g("br"),n._v("en cua tui . Ｎet ] http://ngantruyen.com/"),g("br")]),n._v(" “Không phải hoài nghi ngươi, mà là, để cho người ta không thể không muốn! Ngươi nói với ta, Trần Triết làm ra vi phạm danh sư chuyện, phải bắt được thẩm vấn, ta không có cự tuyệt, kết quả... Hắn cũng vô duyên vô cớ chết! Danh Sư đường canh phòng nghiêm khắc, ngoại trừ ngươi, ai cũng không cách nào tới gần, nếu như không phải dùng cực hình, muốn vu oan giá hoạ, lại thế nào khả năng tử vong?”"),g("br"),n._v("“Vị kia Trương Huyền, ta chuyên môn đã điều tra, các ngươi từng có cùng nhau xuất sinh nhập tử kinh nghiệm, cá nhân cảm tình rất sâu, nghiêng về đối phương, hoặc là phiền phức để hắn làm ngụy chứng, cũng không phải không thể nào!”"),g("br"),g("br"),n._v("Cẩu đường chủ khẽ nói: “Ngươi vừa mới trở thành phó đường chủ, muốn lập công, muốn thay thế Điền Thanh, ta đều có thể đã hiểu, nhưng... Bất kể làm chuyện gì, đều cần chứng cứ đi, biến thành như vậy, để cho ta làm sao không hoài nghi?”"),g("br"),g("br"),n._v("“Ta đối phó đường chủ vị trí, không có lòng mơ ước, càng không có gia hại Điền phó đường chủ...”"),g("br"),g("br"),n._v("Da đầu nổ tung, Ngô sư gấp gáp nói."),g("br"),g("br"),n._v("Không nghĩ tới Cẩu đường chủ thế mà hoài nghi hắn, cố ý hãm hại Điền Thanh, muốn thay vào đó."),g("br"),g("br"),n._v("“Tốt rồi, chuyện này, ta không nghĩ tới nhiều thảo luận, ta mặc kệ các ngươi làm sao tranh, làm sao đấu... Cũng không cần làm ra ảnh hưởng phân bộ thanh danh sự tình tới!”"),g("br"),g("br"),n._v("Cẩu đường chủ ngắt lời hắn: “Ta trở thành đường chủ vượt qua năm trăm năm, chúng ta Danh Sư đường, trong tay ta, cứ việc không có phát dương quang đại, nhưng cũng không có bất kỳ cái gì chỗ bẩn, bây giờ lập tức liền muốn về hưu, không muốn bị người chỉ trích, để tổng bộ tới thẩm tra, biến thành đế quốc khác Danh Sư đường trò cười!”"),g("br"),g("br"),n._v("“Đường chủ, ta thật không phải là vì tranh quyền... Vị này Trương sư, mặc dù cùng ta từng có đồng sinh cộng tử, lại không nghe ta sai khiến...”"),g("br"),g("br"),n._v("Không nghĩ tới, Cẩu đường chủ mặc kệ thế sự, vừa xuất hiện liền cho hắn chụp như vậy một cái chụp mũ, Ngô sư vội nói."),g("br"),g("br"),n._v("“Đủ rồi! Ta đều nói qua, các ngươi phá sự, ta không muốn quản, nhưng mà ta không muốn chúng ta Danh Sư đường nội bộ gây ra mâu thuẫn, để người ngoài chê cười!” Cẩu đường chủ thanh âm trở nên băng lãnh: “Ngươi nghe không hiểu ta ý tứ?”"),g("br"),g("br"),n._v("“Ta... Là!” Ngô sư hàm răng cắn chặt."),g("br"),g("br"),n._v("“Ừm, rõ ràng liền tốt, như vậy, ngươi phái người đem cái kia Trương Huyền mang tới, tốt tốt đem chuyện nói rõ ràng, nghe lời ngược lại cũng thôi, không nghe lời, chỉ bằng vào phạm thượng, đối thất tinh danh sư động thủ, liền đầy đủ cả một đời lật người không nổi...”"),g("br"),g("br"),n._v("Cẩu đường chủ dặn dò, lời còn chưa dứt, một cái thanh âm nhàn nhạt liền vang lên, lập tức cửa phòng đẩy ra, thanh niên chậm rãi đi đến."),g("br"),g("br"),n._v("“Không cần phái người, ta đã tới...”"),g("br"),g("br"),n._v("Chính là Trương Huyền."),g("br"),g("br"),n._v("Lúc đầu hắn chỉ nghĩ tới tới khảo hạch thất tinh danh sư, không nghĩ tới nghe được những này, tức giận đến sắp nổi khùng."),g("br"),g("br"),n._v("Còn tưởng rằng vị này Cẩu đường chủ chỉ là hồ đồ, mới trọng dụng Điền Thanh loại tiểu nhân này, không nghĩ tới, là cái chỉ biết là yên lặng chuyển tiếp ngu ngốc hạng người."),g("br"),g("br"),n._v("“Trương sư...”"),g("br"),g("br"),n._v("Ngô sư giật nảy mình, một mặt cuống cuồng."),g("br"),g("br"),n._v("Từ lời nói mới rồi, hắn có thể nghe ra, đường chủ đối vị này rõ ràng không vui, lúc này đi ra, một khi dẫn đến nổi giận, liền lại không khả năng cứu vãn."),g("br"),g("br"),n._v("“Đường chủ, vị này liền là hãm hại ta vị kia Trương Huyền, Hồng Viễn đế quốc danh sư học viện viện trưởng!”"),g("br"),g("br"),n._v("Mắt sáng lên, Điền Thanh vội nói."),g("br"),g("br"),n._v("“Ngươi chính là Trương Huyền?”"),g("br"),g("br"),n._v("Cẩu đường chủ híp mắt lại: “Thất tinh danh sư thương nghị chuyện, ngươi một cái nho nhỏ lục tinh, thế mà ở bên ngoài nghe lén... Thật to gan!”"),g("br"),g("br"),n._v("“Thật không tiện... Lá gan của ta còn chưa đủ lớn, không bằng ngươi!”"),g("br"),g("br"),n._v("Trương Huyền lắc đầu."),g("br"),g("br"),n._v("“Ngươi nói cái gì?”"),g("br"),g("br"),n._v("Vỗ bàn một cái, Cẩu đường chủ khí tức như rồng, mang theo lửa giận."),g("br"),g("br"),n._v("Hắn là Danh Sư đường đường chủ, canh giữ một phương siêu cấp đại năng, đối phương một cái nho nhỏ học viện viện trưởng, dám nói như vậy, quả thực không biết lễ phép, vô pháp vô thiên."),g("br"),g("br"),n._v("“Ta nói cái gì, chính ngươi trong lòng không có bức số ư?”"),g("br"),g("br"),n._v("Đối mặt với đối phương lửa giận, Trương Huyền không có chút nào lo lắng, mà là vẻ mặt lạnh nhạt nhìn qua: “Ngô sư cái gì tính tình bản tính, ở chung nhiều năm như vậy, ta không tin ngươi không biết... Vị này Điền phó đường chủ, mượn nhờ độc sư mưu hại tại ta, càng là đối với ta cùng học sinh của ta, quản gia ra tay... Như vậy kém đi, không đi điều tra, lại tại nơi này trách cứ Ngô sư, ngươi là mắt mù, còn là đầu óc có vấn đề? Thanh Nguyên đế quốc Danh Sư đường, tại sao có thể có ngươi ngu xuẩn như vậy đường chủ?”"),g("br"),g("br"),n._v("“Trương sư...”"),g("br"),g("br"),n._v("Không nghĩ tới từ trước tới nay tính tình tốt Trương sư, thế mà cùng Cẩu đường chủ mạnh mẽ chống đỡ, nói ra lời này, Ngô sư dọa đến sắp điên rồi."),g("br"),g("br"),n._v("Lúc đầu, đường chủ đối với hắn liền có thành kiến, lần này, có thể nói, lại không khả năng cứu vãn."),g("br"),g("br"),n._v("“Thật là lớn gan chó! Nho nhỏ lục tinh danh sư, bỏ qua quy củ, sỉ nhục thất tinh đỉnh phong danh sư, đã xúc phạm lễ phép, đường chủ, ta hiện tại liền đem hắn đem ra công lý, huỷ bỏ tu vi...”"),g("br"),g("br"),n._v("Hét lớn một tiếng, Điền Thanh cũng không cần đường chủ nói chuyện, bàn tay một trảo, lăng không liền Trương Huyền đập tới."),g("br"),g("br"),n._v("“Ngươi dám...”"),g("br"),g("br"),n._v("Biến sắc, Ngô sư vội vàng tiến lên đón, muốn ra tay chặn lại công kích của đối phương."),g("br"),g("br"),n._v("“Không cần...”"),g("br"),g("br"),n._v("Lắc đầu, Trương Huyền bàn tay dựng thẳng lên, nhẹ nhàng vỗ."),g("br"),g("br"),n._v("Bành!"),g("br"),g("br"),n._v("Điền phó đường chủ còn không có kịp phản ứng, liền bị một chưởng đánh bay rớt ra ngoài, dán tại trên tường đập ra một cái hố to."),g("br"),g("br"),n._v("Giống như là đánh bay một con kiến hôi, Trương Huyền từng bước một tiến về phía trước đi tới, ánh mắt như điện, thanh âm càng ngày càng vang dội, lập tức truyền thấu toàn bộ Thanh Nguyên Đế đô."),g("br"),g("br"),n._v("“Từ Thiên Huyền vương quốc từng bước một đi tới, một đường tung hoành, chưa từng có người dám hãm hại ta, dám cùng ta nói như vậy lời nói!”"),g("br"),g("br"),n._v("“Ta Trương Huyền, lấy lục tinh danh sư thân phận, xin tổng bộ...”"),g("br"),g("br"),n._v("“Xông Thanh Nguyên đế quốc Danh Sư đường!”"),g("br"),g("br"),n._v("“Không chết... Không ngừng!”"),g("br"),g("br"),n._v("(Canh thứ hai đến! Cao trào lập tức tới đây, còn có nguyệt phiếu ư?)"),g("br"),g("br"),g("br"),g("br")]),n._v(" "),g("hr"),n._v(" "),g("p",[g("a",{attrs:{href:"./chap-1186"}},[n._v("Chương trước")]),n._v("  |  "),g("a",{attrs:{href:"./chap-1188"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=t.exports}}]);